import React from 'react';
import './_app';
function Home(){

      return (
        <div class="intro-header"> 
<div class="container"  align="center">

<div class="tab-content custom-tab-content" align="center">
<div class="subscribe-panel">
<h1>Newsletter!!!</h1>
<p>Inscreva-se agora!!! </p>

                <form action="" method="post">

							<div class="col-md-4"></div>
							<div class="col-md-4">
								<div class="input-group">
									<span class="input-group-addon"><i class="glyphicon glyphicon-envelope" aria-hidden="true"></i></span>
									<input type="text" class="form-control input-lg" name="email" id="email"  placeholder="Enter your Email"/>
								</div>
							</div>
							<div class="col-md-4"></div>
                    <br/><br/><br/>
                    <button class="btn btn-warning btn-lg">Inscreva-se</button>
              </form>

</div>
</div>
</div>
</div>
      );
    };

    export default Home;
